            />
            <Button
                style={{ marginTop: 20, backgroundColor: 'orange' }}
                icon="login"
                mode="outlined"
                //onPress={handleSignIn}
            >
                Iniciar Sesión
            </Button>
            <Button
                style={{ marginTop: 20, backgroundColor: 'yellow' }}
                icon="account"
                mode="outlined"
                //onPress={handleCreateAccount}
            >
                Crear Cuenta
            </Button>
            <Text style={{color:'green'}}>{message}</Text>
        </View>
    </View>
)
}
